import React from 'react'

const Advantages = () => {
    return (
        <div className='advantage-bg '>
            <h1 className=" text-center pt-2 mb-1 advantage-h1 font-weight-bold font-outfit">The REDHANDED Advantage</h1>
            <h5 class="  text-center mb-1 advantage-h5 bold-me font-outfit">Welcome to the new face of Commercial Real Estate Leasing!</h5>
        </div>
    )
}

export default Advantages
